webpackJsonp([0x834755aae49e],{510:function(e,o){e.exports={data:{site:{siteMetadata:{title:"uncontainable poetry",author:"Michelle Wong"}},markdownRemark:{id:"/Users/michellewong/Desktop/uncontainable-poems/src/pages/hello-world/index.md absPath of file >>> MarkdownRemark",html:'<blockquote>\n<p>Because I loved you without writing pseudocode, and I had no coverage  </p>\n</blockquote>\n<p>be careful for who you give your heart to<br>\nand if at all<br>\nthe problem for me though, is that I love binary<br>\nwhich means if so, all, if not, not at all<br>\nThere is no in between.<br>\nAnd if you ask me whether or not I checked my code before I submitted, I’ll say no.<br>\nBecause I loved you without writing pseudocode, and I had no coverage<br>\nI let you pass through the screenings, no rejection email, no ghosts<br>\nNone of that bullshit people call “dating”<br>\nIf you ask me if I loved you,<br>\nI’ll say yes.<br>\nAnd if you asked me how much,<br>\nI’ll say 1.</p>\n<p>Link to the original handwritten post on Insta:\n<a href="https://www.instagram.com/p/Ba-j2pXFHcvQ1DlDoW0-JJhD6spq4lz4yzmrhE0/?taken-by=michelluritoo">binarypoem</a>.</p>',frontmatter:{title:"i love binary",date:"November 01, 2017"}}},pathContext:{slug:"/hello-world/",previous:{fields:{slug:"/hi-folks/"},frontmatter:{title:"New Beginnings"}},next:{fields:{slug:"/my-second-post/"},frontmatter:{title:""}}}}}});
